import { StyleSheet, Text, View} from 'react-native';


export default function MainScreen(navigation){
    return(
        <View><Text>HelloWorld</Text></View>
    );
}


const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#fff',
      alignItems: 'center',
      justifyContent: 'center',
    },
  });
